import { Button, Modal, TextField } from "@mui/material";
import React from "react";

const EditModal = ({ open, handelModalClose }) => {
  return (
    <Modal
      open={open}
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          height: "70vh",
          width: "40%",
          borderRadius: 10,
          border: "1px solid black",
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <div
          style={{
            height: "80%",
            width: "80%",
            padding: 10,
            display: "flex",
            flexDirection: "column",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <div
            style={{
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
              flex: 1,
              width: "100%",
              borderBottom: "1px solid black",
            }}
          >
            <h1 style={{ color: "orange" }}> COIN NAME</h1>
          </div>
          <div
            style={{
              display: "flex",
              flex: 6,
              width: "100%",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            <TextField
              fullWidth
              type="text"
              name="coin"
              label="COIN NAME"
              variant="outlined"
            />
            <Button
              style={{
                marginTop: 30,
                width: "100%",
                color: "#fff",
                background: "#4F709C",
              }}
              type="submit"
              onClick={handelSubmit}
            >
              Send
            </Button>
          </div>
        </div>
      </div>
    </Modal>
  );
};

export default EditModal;
